import React from 'react';
import { Meeting } from '../types/Meeting';
import './MeetingTable.css';

interface MeetingTableProps {
  meetings: Meeting[];
  selectedMeetings: string[];
  onMeetingSelect: (meetingId: string, isSelected: boolean) => void;
  onWebexJoin: (meeting: Meeting) => void;
  onMinutesAction: (meeting: Meeting) => void;
}

const MeetingTable: React.FC<MeetingTableProps> = ({
  meetings,
  selectedMeetings,
  onMeetingSelect,
  onWebexJoin,
  onMinutesAction
}) => {
  const getStatusColor = (status: string) => {
    switch (status) {
      case 'scheduled':
        return 'status-scheduled';
      case 'in-progress':
        return 'status-in-progress';
      case 'completed':
        return 'status-completed';
      default:
        return '';
    }
  };

  const getStatusText = (status: string) => {
    switch (status) {
      case 'scheduled':
        return '예정';
      case 'in-progress':
        return '진행중';
      case 'completed':
        return '완료';
      default:
        return status;
    }
  };

  const formatAttendees = (attendees: string[], total: number) => {
    if (attendees.length === 0) return '';
    const displayAttendees = attendees.slice(0, 3);
    const remaining = total - attendees.length;
    if (remaining > 0) {
      return `${displayAttendees.join(', ')} 외 ${remaining}명`;
    }
    return displayAttendees.join(', ');
  };

  return (
    <div className="table-container">
      <table className="meeting-table">
        <thead>
          <tr>
            <th className="checkbox-header">
              <input
                type="checkbox"
                checked={selectedMeetings.length === meetings.length && meetings.length > 0}
                onChange={(e) => {
                  meetings.forEach(meeting => {
                    onMeetingSelect(meeting.id, e.target.checked);
                  });
                }}
              />
            </th>
            <th>회의명</th>
            <th>일시</th>
            <th>장소</th>
            <th>주관자</th>
            <th>참석자</th>
            <th>WebEx</th>
            <th>상태</th>
            <th>회의록</th>
          </tr>
        </thead>
        <tbody>
          {meetings.map((meeting) => (
            <tr key={meeting.id}>
              <td className="checkbox-cell">
                <input
                  type="checkbox"
                  checked={selectedMeetings.includes(meeting.id)}
                  onChange={(e) => onMeetingSelect(meeting.id, e.target.checked)}
                />
              </td>
              <td className="meeting-name">{meeting.name}</td>
              <td className="meeting-datetime">
                <div className="datetime-info">
                  <i className="fas fa-calendar"></i>
                  <span>{meeting.date}</span>
                </div>
                <div className="datetime-info">
                  <i className="fas fa-clock"></i>
                  <span>{meeting.time}</span>
                </div>
              </td>
              <td className="meeting-location">{meeting.location}</td>
              <td className="meeting-organizer">
                {meeting.organizer.name} {meeting.organizer.title}
              </td>
              <td className="meeting-attendees">
                {formatAttendees(meeting.attendees, meeting.totalAttendees)}
              </td>
              <td className="meeting-webex">
                {meeting.webexUrl && (
                  <button
                    onClick={() => onWebexJoin(meeting)}
                    className="webex-button"
                  >
                    <i className="fas fa-video"></i>
                  </button>
                )}
              </td>
              <td className="meeting-status">
                <span className={`status-badge ${getStatusColor(meeting.status)}`}>
                  {getStatusText(meeting.status)}
                </span>
              </td>
              <td className="meeting-minutes">
                <button
                  onClick={() => onMinutesAction(meeting)}
                  className={`minutes-button ${meeting.minutesStatus === 'write' ? 'write' : 'view'}`}
                >
                  {meeting.minutesStatus === 'write' ? (
                    <>
                      <i className="fas fa-pencil-alt"></i>
                      <span>작성</span>
                    </>
                  ) : (
                    <>
                      <i className="fas fa-eye"></i>
                      <span>보기</span>
                    </>
                  )}
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MeetingTable;
